const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between">
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <NavLink href="/">Jobaho</NavLink>
    </Flex>
    <Box>
      <Link href="/">Jobaho</Link>
      <Link href="/">Home</Link>
      <Link href="/about">About</Link>
      <Link href="/jobSection">Find a Job</Link>
    </Box>
  </Flex>
);

export default Navbar;
